Les tiges célestes (天干, tiāngān) également appelés troncs célestes sont une notion chinoise liée au cycle sexagésimal, un ancien système cyclique de numérotation et de datation encore utilisé en astrologie chinoise et dans certaines disciplines du feng shui notamment. Les tiges célestes sont au nombre de dix et ont été associées aux concepts de yin et yang ou le yin est la femelle et le yang le mâle, et des cinq éléments. Les tiges célestes sont encore utilisées en Chine et au Japon comme système alphabétique ou système de numérotation, y compris sur les documents légaux. Ainsi : 
* en chimie organique, les tiges célestes représentent le nombre de carbone des groupes fonctionnels : méthane (甲烷 jiǎwán), éthane (乙烷 yǐwán)… ; 
* en médecine, les tiges célestes sont souvent utilisées dans le nom des maladies là où les occidentaux utilisent des lettres alphabétiques : hépatite A (甲型肝炎 jiǎxínggānyán), hépatite B (乙型肝炎 yǐxínggānyán), etc. ; 
* pour donner des notes : 甲 pour « très bien », 乙 pour « bien », 丙 pour « assez bien », etc. Généralement, aux tiges célestes s'ajoute également le caractère yōu (優), « excellent » ; 
* les séries des clubs de sports : première division (意甲 yìjiǎ), deuxième division (意乙 yìyǐ), etc. 
* Au Japon, dans le langage juridique, 甲 désigne la partie active d'un acte, 乙 la partie passive, et 丙 ou 丁 sont utilisés pour désigner les tiers. Par exemple, dans un contrat de vente, 甲 désignera le vendeur, 乙 désignera l'acheteur, et 丙 ou 丁 pourront par exemple désigner les cautions solidaires de l'acheteur.
